One mongo connection in multiple Node modules<p>I am trying to have all my Node modules share one Mongo connection, and am having trouble doing so. I've looked at some of the materials written about this already. Below is the main file, the Mongo helper file, and another file that tries to use the connection. The trouble is that when the route file tries to use the Mongo connection, <code>db</code> is null.</p>

<p>Mongo helper file:</p>

<pre><code>var mongo = require('mongodb').MongoClient

var _db

function connect(callback) {
    const host = '---'
    const database = '---'
    const user = '---'
    const pass = '---'
    const uri = 'mongodb://' + user + ':' + pass + '@' + host + '/' + database

    mongo.connect(uri, (err, client) =&gt; {
        console.log('Connected to Mongo')
        _db = client.db(database)
        return callback(err)
    })
}

function db() {
    return _db;
}

module.exports = {
    connect: connect,
    db: db
}
</code></pre>

<p>Main file:</p>

<pre><code>var express = require('express')
var app = express()
var mongo = require('./helpers/mongo')
mongo.connect((err) =&gt; {
    if (err !== null) {
        console.log("Error connecting to Mongo: " + err)
        process.exit()
    }
})

var problems = require('./routes/problems.js')
app.use('/problem', problems)

app.listen(3000)
</code></pre>

<p>Route file:</p>

<pre><code>var express = require('express')
var router = express.Router()
var db = require('../helpers/mongo').db()

router.get('/stuff', (req, res) =&gt; {
    var problems = db.collection('problems')
    res.send('working correctly')
})

module.exports = router
</code></pre>

